  return (
    <div className="about">
        <div className="left">
            <h1>Who Am I?</h1>
            <p>I'm a react Front End Developer. I create Resposive Secure
                websites for my clients
            </p>
            <Link to="/contact">
                <button className="btn">Contact</button>
            </Link>
        </div>

        <div className="right">

        </div>
    </div>
  );
};

export default AboutContent;
